import './footer.css';
import { Link } from 'react-router-dom';
// import logo from '../img/Logo.svg';



function Footer() {
  return (
     <footer>
<Container>

<div className="footerbox">
       <div className="contactus">

       </div>
       <hr/>
       <div className="logo">

       </div>
       <hr/>
       <div className="unity">
          <h1>Utility Pages</h1>
          <li><Link to="">Style Guide</Link></li>
          <li><Link to="404 Not Found">404 Not Found</Link></li>
          <li><Link to="404 Not Found">Password Protected</Link></li>
          <li><Link to="404 Not Found">

Licences
Changelog</Link></li>
       </div>
</div>

</Container>
     </footer>
  );
}

export default Footer;
